content:
Bán cao ốc mặt tiền số 14 đường Phan Tôn, phường Đakao, quận 1;
Diện tích 20x30m, công nhận gần 666m2 đất;

Hiện trạng gồm 1 hầm 1 trệt 7 lầu, đang cho thuê giá cao, hợp đồng dài hạn;
Giá mong muốn: 205 tỷ.

Vui lòng LH: 0911.86.37.39 _Ngọc Hải _BĐS VinGrand Center, trân trọng!

Bán nhà MT 1132 Huỳnh Tấn Phát,Q7,hầm 8 tầng.(5x35),HĐT 170tr/th.Giá 31 tỷ

- Diện tích đất công nhận: 147,9m2; tổng Dt đất: 166m2; DTXD: 147,9*8 + 147,9 

- Hầm = 1131 (m2); gác lững trong phòng: 11*25=275m2; Tổng DT sàn XD là 1400 m2; Hầm : để xe máy + kho;
 - Tầng 1: 2 phòng studio + phía trước cho thuê làm shophouse + sân trước; 
- Tầng 2: 5 phòng studio;
 - Tầng 3,4,5,6,7: mỗi tầng 5 phòng có doudled (gác) = 25 phòng có gác; 
- Tầng 8: 3 phòng studio + sân thượng trước + sân phơi đồ phía sau nhà 
* Tổng cộng: 25 phòng có gác + 10 phòng studio
 * Đầy đủ nội thất; 
* Đang có hợp đồng thuê 5 năm giá 170tr/tháng, 2 năm lên giá 7%.
Giá 31 tỷ thương lượng
Liên hệ ngay để được xem nhà chính chủ: C.Sơn 0908.56.97.94
